        "Description": "The Fixometer is a data collection and visualisation tool that lets repair\r\norganisations easily and conveniently collect information on repairs, and\r\nvisualise the impact of those repairs.\r\n\r\nThe Fixometer fits into the Restart Project's vision of changing the world's\r\nrelationship with electronics, by providing a platform for the collection of\r\nopen repair data. It was the initial phase of our development of the open repair\r\ndata standard, which will allow for open repair data to be collected and pooled\r\ntogether from multiple organisations using different tools. The Fixometer\r\ncontinues to be developed as the flagship and archetype tool for open repair\r\ndata collection.\r\n\r\nFor further information, see https://therestartproject.org/fixometer.",
